CKEDITOR.plugins.setLang("a11yhelp","vi",{title:"H\u01b0\u1edbng d\u1eabn tr\u1ee3 n\u0103ng",contents:"N\u1ed9i dung H\u1ed7 tr\u1ee3. Nh\u1ea5n ESC \u0111\u1ec3 \u0111\xf3ng h\u1ed9p tho\u1ea1i.",legend:[{name:"Chung",items:[{name:"Thanh c\xf4ng c\u1ee5 so\u1ea1n th\u1ea3o",legend:"Nh\u1ea5n ${toolbarFocus} \u0111\u1ec3 \u0111i\u1ec1u h\u01b0\u1edbng \u0111\u1ebfn thanh c\xf4ng c\u1ee5. Nh\u1ea5n TAB v\xe0 SHIFT-TAB \u0111\u1ec3 chuy\u1ec3n \u0111\u1ebfn nh\xf3m thanh c\xf4ng c\u1ee5 kh\xe1c. Nh\u1ea5n M\u0168I T\xcaN PH\u1ea2I ho\u1eb7c M\u0168I T\xcaN TR\xc1I \u0111\u1ec3 chuy\u1ec3n sang n\xfat kh\xe1c tr\xean thanh c\xf4ng c\u1ee5. Nh\u1ea5n PH\xcdM C\xc1CH ho\u1eb7c ENTER \u0111\u1ec3 k\xedch ho\u1ea1t n\xfat tr\xean thanh c\xf4ng c\u1ee5."},{name:"H\u1ed9p tho\u1ea1i Bi\xean t",legend:"B\xean trong m\u1ed9t h\u1ed9p tho\u1ea1i, nh\u1ea5n TAB \u0111\u1ec3 chuy\u1ec3n sang tr\u01b0\u1eddng ti\u1ebfp theo, nh\u1ea5n SHIFT + TAB \u0111\u1ec3 quay l\u1ea1i tr\u01b0\u1eddng ph\xeda tr\u01b0\u1edbc, nh\u1ea5n ENTER \u0111\u1ec3 ch\u1ea5p nh\u1eadn, nh\u1ea5n ESC \u0111\u1ec3 \u0111\xf3ng h\u1ed9p tho\u1ea1i. \u0110\u1ed1i v\u1edbi c\xe1c h\u1ed9p tho\u1ea1i c\xf3 nhi\u1ec1u tab, nh\u1ea5n ALT + F10 \u0111\u1ec3 chuy\u1ec3n \u0111\u1ebfn danh s\xe1ch c\xe1c tab. Sau \u0111\xf3 nh\u1ea5n TAB ho\u1eb7c M\u0168I T\xcaN SANG PH\u1ea2I \u0111\u1ec3 chuy\u1ec3n sang tab ti\u1ebfp theo. Nh\u1ea5n SHIFT + TAB ho\u1eb7c M\u0168I T\xcaN SANG TR\xc1I \u0111\u1ec3 chuy\u1ec3n sang tab tr\u01b0\u1edbc \u0111\xf3. Nh\u1ea5n D\u1ea4U C\xc1CH ho\u1eb7c ENTER \u0111\u1ec3 ch\u1ecdn tab."},{name:"Tr\xecnh \u0111\u01a1n Ng\u1eef c\u1ea3nh cB\u1ed9 so\u1ea1n th\u1ea3o",legend:"Nh\u1ea5n ${contextMenu} ho\u1eb7c PH\xcdM \u1ee8NG D\u1ee4NG \u0111\u1ec3 m\u1edf th\u1ef1c \u0111\u01a1n ng\u1eef c\u1ea3nh. Sau \u0111\xf3 nh\u1ea5n TAB ho\u1eb7c M\u0168I T\xcaN XU\u1ed0NG \u0111\u1ec3 di chuy\u1ec3n \u0111\u1ebfn tu\u1ef3 ch\u1ecdn ti\u1ebfp theo c\u1ee7a th\u1ef1c \u0111\u01a1n. Nh\u1ea5n SHIFT+TAB ho\u1eb7c M\u0168I T\xcaN L\xcaN \u0111\u1ec3 quay l\u1ea1i tu\u1ef3 ch\u1ecdn tr\u01b0\u1edbc. Nh\u1ea5n D\u1ea4U C\xc1CH ho\u1eb7c ENTER \u0111\u1ec3 ch\u1ecdn tu\u1ef3 ch\u1ecdn c\u1ee7a th\u1ef1c \u0111\u01a1n. Nh\u1ea5n D\u1ea4U C\xc1CH ho\u1eb7c ENTER ho\u1eb7c M\u0168I T\xcaN SANG PH\u1ea2I \u0111\u1ec3 m\u1edf th\u1ef1c \u0111\u01a1n con c\u1ee7a tu\u1ef3 ch\u1ecdn hi\u1ec7n t\u1ea1i. Nh\u1ea5n ESC ho\u1eb7c M\u0168I T\xcaN SANG TR\xc1I \u0111\u1ec3 quay tr\u1edf l\u1ea1i th\u1ef1c \u0111\u01a1n g\u1ed1c. Nh\u1ea5n ESC \u0111\u1ec3 \u0111\xf3ng th\u1ef1c \u0111\u01a1n ng\u1eef c\u1ea3nh."},{name:"H\u1ed9p danh s\xe1ch tr\xecnh bi\xean t\u1eadp",legend:"Inside a list-box, move to next list item with TAB OR DOWN ARROW. Move to previous list item with SHIFT + TAB or UP ARROW. Press SPACE or ENTER to select the list option. Press ESC to close the list-box."},{name:"Editor Element Path Bar",legend:"Press ${elementsPathFocus} to navigate to the elements path bar. Move to next element button with TAB or RIGHT ARROW. Move to previous button with  SHIFT+TAB or LEFT ARROW. Press SPACE or ENTER to select the element in editor."}]},{name:"Commands",items:[{name:" Undo command",legend:"Press ${undo}"},{name:" Redo command",legend:"Press ${redo}"},{name:" Bold command",legend:"Press ${bold}"},{name:" Italic command",legend:"Press ${italic}"},{name:" Underline command",legend:"Press ${underline}"},{name:" Link command",legend:"Nh\u1ea5n ${link}"},{name:" Toolbar Collapse command",legend:"Nh\u1ea5n${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Accessibility Help",legend:"Nh\u1ea5n ${a11yHelp}"}]}]});